import React from 'react';
import { Player } from 'video-react';

function Video() {
  return (
   <section className="video-test-section">
   	<div className="row">
   		{/*<div className="col-md-4 video-item">Video 1</div>*/}
   		<div className="col-md-6 video-item">
	   		<Player
		      playsInline
		      poster="./images/heart.svg"
		      src="./video/test-1.mp4"/>
	     </div>
   		<div className="col-md-6 video-item">
	   		<Player
		      playsInline
		      poster="./images/heart.svg"
		      src="./video/test-2.mp4"/>
      	</div>

   		<div className="col-12 main-video">
   		 <Player
	      playsInline
	      poster="./images/heart.svg"
	      src="./images"/>
   		</div>
   	</div>
   </section>
  );
}

export default Video;
